/* Double Linked List Definition */

struct Instruction;

typedef struct Instruction {
	cs_insn *instruction;
	struct Instruction *next;
	struct Instruction *prev;
	bool invalid;
} Instruction;

typedef struct List {
	int count;
	Instruction *first;
	Instruction *last;
} List;

List *ListCreate();
void ListDestroy(List *list);

void ListPush(List *list, Instruction *new_insn);
void ListInsertBefore(List *list, Instruction *old_insn, Instruction *new_insn);
void ListInsertAfter(List *list, Instruction *old_insn, Instruction *new_insn);
void ListRemove(List *list, Instruction *old_insn);
void ListReplace(Instruction *old_insn, Instruction *new_insn);
void ListCopy(List *new_list, List *old_list);

#define ListCount(A) ((A)->count)
#define ListFirst(A) ((A)->first != NULL ? (A)->first->value : NULL)
#define ListLast(A) ((A)->last != NULL ? (A)->last->value : NULL)

/* Double Linked List Implementation */

List *ListCreate() {
	return calloc(1, sizeof(List));
}

void ListCopy(List *new_list, List *old_list) {
	Instruction *current = old_list->first;
	Instruction *temp;
	while(current != NULL) {
		temp = calloc(1, sizeof(Instruction));
		temp->instruction = calloc(1, sizeof(cs_insn));
		memcpy(temp->instruction, current->instruction, sizeof(cs_insn));
		ListPush(new_list, temp);
		current = current->next;
	}
}

void ListDestroy(List *list) {
	Instruction *current = list->first;
	while(current != NULL) {
		free(current->instruction);
		current = current->next;
	}
	free(current);
	free(list->first);
    free(list->last);
    free(list);
}

void ListInsertAfter(List *list, Instruction *old_insn, Instruction *new_insn) {
	if(new_insn == NULL) {
		return;
	}
	if(old_insn != NULL) {
		//Next old instruction update
		Instruction *next = old_insn->next;
		if(next != NULL) {
			next->prev = new_insn;
		}
		//Update new_insn prev & next
		new_insn->prev = old_insn;
		new_insn->next = next;
		//Update old_insn next
		old_insn->next = new_insn;
		if(list->last == old_insn) {
			list->last = new_insn;
		}
	}
	//increment List size
	list->count++;
}

void ListInsertBefore(List *list, Instruction *old_insn, Instruction *new_insn) {
	if(old_insn != NULL) {
		//Next old instruction update
		Instruction *prev = old_insn->prev;
		prev->next = new_insn;
		//Update new_insn prev & next
		new_insn->prev = prev;
		new_insn->next = old_insn;
		//Update old_insn next
		old_insn->prev = new_insn;
		if(list->first == old_insn) {
			list->first = new_insn;
		}
	}
	//increment List size
	list->count++;
}

void ListPush(List *list, Instruction *new_insn) {
	if(list->last == NULL) {
		list->first = new_insn;
		list->last = new_insn;
	} else {
		list->last->next = new_insn;
		new_insn->prev = list->last;
		list->last = new_insn;
	}
}

void ListRemove(List *list, Instruction *old_insn) {
	if(old_insn == NULL) {
		return;
	}
	if(list->first == old_insn) {
		list->first = old_insn->next;
	}
	if(list->last == old_insn) {
		list->last = old_insn->prev;
	}
	if(old_insn->prev != NULL) {
		old_insn->prev->next = old_insn->next;
	}
	if(old_insn->next != NULL) {
		old_insn->next->prev = old_insn->prev;
	}
	//free(old_insn);
}

void ListReplace(Instruction *old_insn, Instruction *new_insn) {
	memcpy(old_insn->instruction, new_insn->instruction, sizeof(cs_insn));
}

bool ListIsBefore(Instruction *first, Instruction *second) {
	//check if "first" is encountered before "second"
	Instruction *temp = first;
	while(temp != NULL) {
		if(temp == second) {
			return true;
		}
		temp = temp->next;
	}
	return false;
}

