void print_disassembly(csh handle, List *list, bool advanced) {
	cs_x86 *x86;
	cs_x86_op *op;
	size_t op_count = 0;
	size_t counter = 0;
	Instruction *current = list->first;
	while(current != NULL) {
		if(advanced) {
			printf("0x%llx %s %s (invalid: %d)\n", current->instruction->address, current->instruction->mnemonic, current->instruction->op_str, current->invalid);
		} else {
			printf("%s %s\n", current->instruction->mnemonic, current->instruction->op_str);
		}
		if(advanced /*&& !current->invalid*/) {
			x86 = &(current->instruction->detail->x86);
			op_count = x86->op_count;
			for(size_t i = 0; i < op_count; i++) {
				op = &(x86->operands[i]);
				switch(op->access) {
					case CS_AC_READ:
						printf("\t\tCS_AC_READ (%d)\n", op->access);
						break;
					case CS_AC_WRITE:
						printf("\t\tCS_AC_WRITE (%d)\n", op->access);
						break;
					case CS_AC_READ|CS_AC_WRITE:
						printf("\t\tCS_AC_READ|CS_AC_WRITE (%d)\n", op->access);
						break;
					default:
						printf("\t\tUNKNOWN (%d)\n", op->access);
						break;
				}
				switch((int)op->type) {
					case X86_OP_REG:
						printf("\t\toperands[%u].type: REG = %s\n", i, cs_reg_name(handle, op->reg));
						break;
					case X86_OP_IMM:
						printf("\t\toperands[%u].type: IMM = 0x%llx\n", i, op->imm);
						break;
					case X86_OP_FP:
						printf("\t\toperands[%u].type: FP = %f\n", i, op->fp);
						break;
					case X86_OP_MEM:
						printf("\t\toperands[%u].type: MEM\n", i);
						if (op->mem.segment != X86_REG_INVALID)
							printf("\t\t\toperands[%u].mem.segment: REG = %s\n", i, cs_reg_name(handle, op->mem.segment));
						if (op->mem.base != X86_REG_INVALID)
							printf("\t\t\toperands[%u].mem.base: REG = %s\n", i, cs_reg_name(handle, op->mem.base));
						if (op->mem.index != X86_REG_INVALID)
							printf("\t\t\toperands[%u].mem.index: REG = %s\n", i, cs_reg_name(handle, op->mem.index));
						if (op->mem.scale != 1)
							printf("\t\t\toperands[%u].mem.scale: %u\n", i, op->mem.scale);
						if (op->mem.disp != 0)
							printf("\t\t\toperands[%u].mem.disp: 0x%llx\n", i, op->mem.disp);
						break;
					default:
						break;
				}
			}
			if(current->instruction->detail->regs_write_count > 0) {
				printf("[REG WRITE]: ");
				for(size_t i = 0; i < current->instruction->detail->regs_write_count; i++) {
					printf("(%s)", cs_reg_name(handle, current->instruction->detail->regs_write[i]));
				}
			}
			if(current->instruction->detail->regs_read_count > 0) {
				printf("\n[REG READ]: ");
				for(size_t i = 0; i < current->instruction->detail->regs_read_count; i++) {
					printf("(%s)", cs_reg_name(handle, current->instruction->detail->regs_read[i]));
				}
			}
			printf("\n[HEX]: ");
			for(size_t i = 0; i < current->instruction->size; i++) {
				printf("%02x ", current->instruction->bytes[i]);
			}
			printf("\n");
		}
		current = current->next;
	}
}

/* Instruction Modification */

bool update_disasm(Instruction *insn, uint8_t mode) {
	csh handle;
	size_t count;

	if(cs_open(CS_ARCH_X86, mode, &handle) != CS_ERR_OK) {
		printf("[-] Error: cs_open, cannot start disassembler.\n");
		return false;
	}
	cs_option(handle, CS_OPT_DETAIL, CS_OPT_ON);
	count = cs_disasm(handle, insn->instruction->bytes, insn->instruction->size, 0x1000, 0, &insn->instruction);
	if(count >= 1) {
	} else {
		printf("[-] Error: cs_disasm, error while disassembling.\n");
		return false;
	}
	cs_close(&handle);
	return true;
}

bool reassemble(Instruction *insn, uint8_t mode) {
	//checking if "assemble" function is imported
	if(assemble == NULL) {
		printf("[-] assemble(XEDParse *xedparse) function not found!\n");
		return false;
	}
	XEDPARSE_STATUS result;
	XEDPARSE parse;
	switch(mode) {
		case CS_MODE_32:
			parse.x64 = false;
			break;
		case CS_MODE_64:
			parse.x64 = true;
			break;
	}
	parse.cip = 0;
	char instr[256] = "";
	strcat(instr, insn->instruction->mnemonic);
	strcat(instr, " ");
	strcat(instr, insn->instruction->op_str);
	instr[strlen(instr)] = 0;
	strcpy(parse.instr, instr);
	result = assemble(&parse);
	if(result == XEDPARSE_ERROR) {
		//printf("parse.x64: %d\n", parse.x64);
		printf("[!] Error: \"%s\" while assembling \"%s\"\n", parse.error, parse.instr);
		return false;
		//return true;
	}
	insn->instruction->size = parse.dest_size;
	memcpy(insn->instruction->bytes, parse.dest, parse.dest_size);
	return result;
}

