/* Collapsing add / sub & calculating ESP/RSP register value */

bool collapse_add_sub(csh handle, List *list, uint8_t mode, bool stack_only) {
	//printf("\n[+] ---- collapse_add_sub ---- [+]\n");
	//print_disassembly(handle, list, INFO);
	bool optimized = false;
	Instruction *current = list->first, *next = NULL, *propagate = NULL;
	//capstone pointers
	cs_x86 *x86 = NULL;
	cs_x86_op *op = NULL;
	size_t op_count = 0;
	//loop all the instructions in the list
	while(current != NULL) {
		//save the next instruction, because 'current' may be removed
		next = current->next;
		//ignore invalid instructions
		if(current->invalid) {
			current = next;
			continue;
		}
		//check if the instruction is an add/sub
		if(strncmp(current->instruction->mnemonic, "add", 3) == 0 || strncmp(current->instruction->mnemonic, "sub", 3) == 0) {
			//extract information from the current instruction: type, register & immediate (we are interested in instructions of the type "add/sub reg, value")
			bool is_curr_add = (strncmp(current->instruction->mnemonic, "add", 3) == 0) ? true : false;
			x86 = &(current->instruction->detail->x86);
			op_count = x86->op_count;
			uint8_t current_reg = X86_REG_INVALID;
			uint64_t current_imm = 0;
			bool current_reg_found = false, current_imm_found = false;
			//get information from capstone structures
			for(size_t i = 0; i < op_count; i++) {
				op = &(x86->operands[i]);
				//extract register
				if(op->type == X86_OP_REG) {
					if(!stack_only) {
						current_reg = op->reg;
						current_reg_found = true;
					} else {
						if(stack_only && is_same_register_type(op->reg, X86_REG_RSP)) {
							current_reg = op->reg;
							current_reg_found = true;
						}
					}
				}
				//extract immediate
				if(op->type == X86_OP_IMM) {
					current_imm = op->imm;
					current_imm_found = true;
				}
			}
			//printf("\nPropagating: %s %s\n", current->instruction->mnemonic, current->instruction->op_str);
			//printf("current_reg: %s, current_imm: %llx\n", cs_reg_name(handle, current_reg), current_imm);		
			//we are only interested in: "add/sub reg, value"
			if(current_reg_found && current_imm_found) {
				if(current_imm == 0) {
					//if 'current_imm == 0', we can simply delete the instruction
					ListRemove(list, current);
				} else {
					//otherwise we have to propagate its value starting from the next instruction
					propagate = next;
					//loop all the remaining instructions in the list
					while(propagate != NULL) {
						//printf("\nChecking: %s %s\n", propagate->instruction->mnemonic, propagate->instruction->op_str);
						//extract information from the propagate instruction: type, register_read, register_write & immediate
						bool is_add_or_sub = false, is_prop_add = false;
						//checking if the propagate instruction is 'add/sub'
						if(strncmp(propagate->instruction->mnemonic, "add", 3) == 0 || strncmp(propagate->instruction->mnemonic, "sub", 3) == 0) {
							is_add_or_sub = true;
							is_prop_add = (strncmp(propagate->instruction->mnemonic, "add", 3) == 0) ? true : false;
						}
						//extract information from the current instruction: type, register & immediate (we are interested in instructions of the type "add/sub reg, value")
						x86 = &(propagate->instruction->detail->x86);
						op_count = x86->op_count;
						int64_t prop_mem_disp = 0;
						uint64_t prop_imm = 0;
						uint8_t prop_read_reg = X86_REG_INVALID, prop_write_reg = X86_REG_INVALID, prop_readwrite_reg = X86_REG_INVALID, prop_mem_base = X86_REG_INVALID, prop_mem_index = X86_REG_INVALID;
						bool prop_reg_read_found = false, prop_reg_write_found = false, prop_reg_readwrite_found = false, prop_mem_access_found = false, prop_imm_found = false;
						for(size_t i = 0; i < op_count; i++) {
							op = &(x86->operands[i]);
							if(op->type == X86_OP_REG) {
								//extract registers
								if(op->access == CS_AC_WRITE) {
									//this register is written only
									if(!prop_reg_write_found && is_same_register_type(current_reg, op->reg)) {
										prop_write_reg = op->reg;
										prop_reg_write_found = true;
									}
								}
								if(op->access == CS_AC_READ) {
									//this register is read only
									if(!prop_reg_read_found && is_same_register_type(current_reg, op->reg)) {
										prop_read_reg = op->reg;
										prop_reg_read_found = true;
									}
								}
								if(op->access == (CS_AC_READ|CS_AC_WRITE)) {
									//this register is updated (read & write)
									if(!prop_reg_readwrite_found && is_same_register_type(current_reg, op->reg)) {
										prop_readwrite_reg = op->reg;
										prop_reg_readwrite_found = true;
									}
								}
							} else if(op->type == X86_OP_MEM) {
								//extract register use on memory access
								prop_mem_base = op->mem.base;
								prop_mem_index = op->mem.index;
								prop_mem_disp = op->mem.disp;
								prop_mem_access_found = true;
							} else if(op->type == X86_OP_IMM) {
								//extract immediate
								prop_imm = op->imm;
								prop_imm_found = true;
							}
						}
						//check if the 'propagate' instruction uses the same register, if not ignore the instruction
						if(is_same_register_type(current_reg, prop_read_reg) || is_same_register_type(current_reg, prop_write_reg) ||	is_same_register_type(current_reg, prop_readwrite_reg) || is_same_register_type(current_reg, prop_mem_base) || is_same_register_type(current_reg, prop_mem_index)) {
							//printf("prop_imm_found: %d\nprop_reg_write_found: %d\nprop_reg_readwrite_found: %d\nprop_reg_read_found: %d\nprop_mem_access_found: %d\n", prop_imm_found, prop_reg_write_found, prop_reg_readwrite_found, prop_reg_read_found, prop_mem_access_found);
							//if 'current_reg' is used on memory operation, update it: base / index / displacement
							if(prop_mem_access_found && (is_same_register_type(current_reg, prop_mem_base) || is_same_register_type(current_reg, prop_mem_index))) {
								//printf("[M] %s %s\n", propagate->instruction->mnemonic, propagate->instruction->op_str);
								//update the new instruction with memory values: base / index / displacement
								char new_op_str[160] = "", left_op_str[160] = "", right_op_str[160] = "", index_str[30] = "",	disp_str[30] = "";
								char *left_bracket = strchr(propagate->instruction->op_str, '[');
								char *right_bracket = strchr(propagate->instruction->op_str, ']');
								uint8_t left_size = ((uint8_t)(left_bracket - propagate->instruction->op_str) + 1);
								uint8_t right_size = ((uint8_t)(propagate->instruction->op_str + strlen(propagate->instruction->op_str) - right_bracket));
								memcpy(left_op_str, propagate->instruction->op_str, left_size);
								memcpy(right_op_str, right_bracket, right_size);
								//generating new index
								if(prop_mem_index != X86_REG_INVALID) {
									sprintf(index_str, " + %s", cs_reg_name(handle, prop_mem_index));
								}
								//generating new displacement
								//printf("current_imm: 0x%llx\n", current_imm);
								//printf("prop_mem_disp: 0x%llx\n", prop_mem_disp);
								int64_t displacement = 0;
								if(prop_mem_disp >= 0) {
									if(is_curr_add) {
										displacement = prop_mem_disp + current_imm;
										if(displacement != 0)
											sprintf(disp_str, " + 0x%llx", displacement);
									} else {
										if(prop_mem_disp > current_imm) {
											displacement = prop_mem_disp - current_imm;
											if(displacement != 0)
												sprintf(disp_str, " + 0x%llx", displacement);
										} else {
											displacement = current_imm - prop_mem_disp;
											if(displacement != 0)
												sprintf(disp_str, " - 0x%llx", displacement);
										}
									}
								} else {
									if(is_curr_add) {
										prop_mem_disp = (~prop_mem_disp + 1);
										if(prop_mem_disp > current_imm) {
											displacement = prop_mem_disp - current_imm;
											if(displacement != 0)
												sprintf(disp_str, " - 0x%llx", displacement);
										} else {
											displacement = current_imm - prop_mem_disp;
											if(displacement != 0)
												sprintf(disp_str, " + 0x%llx", displacement);
										}
									} else {
										prop_mem_disp = (~prop_mem_disp + 1);
										displacement = prop_mem_disp + current_imm;
										if(displacement != 0)
											sprintf(disp_str, " - 0x%llx", displacement);
									}
								}
								//generating new instruction
								sprintf(propagate->instruction->op_str, "%s%s%s%s%s", left_op_str, cs_reg_name(handle, prop_mem_base), index_str, disp_str, right_op_str);
								if(!(propagate->invalid)) {
									if(!(reassemble(propagate, mode) && update_disasm(propagate, mode))) {
										printf("[-] Error: reassemble() || update_disasm().\n");
									} else {
										//printf("[MEM] %s %s\n", propagate->instruction->mnemonic, propagate->instruction->op_str);
										//if the register is not used as: prop_reg_write_found || prop_reg_read_found || prop_reg_readwrite_found -> move the instruction after 'propagate'
										if(!prop_reg_write_found && !prop_reg_read_found && !prop_reg_readwrite_found) {
											ListRemove(list, current);
											ListInsertAfter(list, propagate, current);
											propagate = NULL;
											optimized = true;
											continue;
										}
										optimized = true;
									}
								} else {
									//the instruction op_str is updated, but could not be reassembled correctly (because of particular "fake" instructions):
									//sub esp, 0x4
									//mov eflags, dword ptr ss:[esp]
									//------------------------------
									//mov eflags, dword ptr ss:[esp-0x4]
									//sub esp, 0x4
									//update only the instruction displacement
									for(size_t i = 0; i < op_count; i++) {
										op = &(x86->operands[i]);
										if(op->type == X86_OP_MEM) {
											//printf("setting new displacement: %d\n", displacement);
											op->mem.disp = displacement;
										}
									}
									//move the add/sub esp/rsp, imm under it
									ListRemove(list, current);
									ListInsertAfter(list, propagate, current);
									propagate = NULL;
									optimized = true;
									continue;
								}
							}
							//we must handle 3 cases:
							//1) current_reg is overwritten only
							//2) current_reg is read only
							//3) current_reg is updated (read+write)
							if(prop_reg_write_found) {
								//printf("[W] %s %s\n", propagate->instruction->mnemonic, propagate->instruction->op_str);
								//printf("[1-2-3-4] remove instruction: %s %s\n", current->instruction->mnemonic, current->instruction->op_str);
								//we must handle 4 sub-cases:
								//1) mov reg1, imm
								//2) mov reg1, reg2
								//3) mov reg1, [reg1]
								//4) mov reg1, [reg2]
								//printf("%s == %s -> is_eq_or_subregister: %d\n", cs_reg_name(handle, current_reg), cs_reg_name(handle, prop_write_reg), is_eq_or_subregister(current_reg, prop_write_reg, true));
								if(is_eq_or_subregister(current_reg, prop_write_reg, true)) {
									//we are in case 1) or 2) or 3) or 4) -> delete the original 'current' if the register is equal to 'current_reg' because it is completely overwritten
									//printf("overwrite instruction: %s %s\n", propagate->instruction->mnemonic, propagate->instruction->op_str);
									ListRemove(list, current);
									optimized = true;
								} else if (is_same_register_type(current_reg, prop_write_reg)) {
									//current_reg is not entirely overwritten -> move it exactly before 'propagate' instruction
									
									//THIS NEEDS A FIX 1:
									//sub eax, 0xFFFFAAAA
									//mov ax, word ptr ds:[eax]; -----> [eax] = 0x7788
									//-------------------------------------------------------
									//mov ax, word ptr ds:[eax - 0xFFFFAAAA]
									//sub eax, 0xFFFF0000
									
									//THIS NEEDS A FIX 2:
									//sub eax, 0xFFFFAAAA
									//lea ax, word ptr ds:[eax]; -----> [eax] = 0x7788
									//-------------------------------------------------------
									//lea ax, word ptr ds:[eax - 0xFFFFAAAA]
									//sub eax, 0xFFFF0000
									
									//calculate new immediate (resized basing on 'prop_write_reg')
									//RAX = 0x50
									//EAX = 0x40
									//AX = 0x30
									
									switch(register_type(prop_write_reg) & 0xF0) {
										case 0x40: {
											current_imm &= 0xFFFFFFFF00000000;
											//printf("current_imm &= 0xFFFFFFFF00000000: 0x%llx\n", current_imm);
											break;
										}
										case 0x30: {
											current_imm &= 0xFFFFFFFFFFFF0000;
											//printf("current_imm &= 0xFFFFFFFFFFFF0000: 0x%llx\n", current_imm);
											break;
										}
									}
									
									//update 'current' instruction
									sprintf(current->instruction->op_str, "%s, 0x%llx", cs_reg_name(handle, current_reg), current_imm);
									if(!(reassemble(current, mode) && update_disasm(current, mode))) {
										printf("[-] Error: reassemble() || update_disasm().\n");
									} else {
										//printf("[NEW] %s %s\n", current->instruction->mnemonic, current->instruction->op_str);
										ListRemove(list, current);
										ListInsertAfter(list, propagate, current);
										optimized = true;
									}
								}
								propagate = NULL;
							} else if(prop_reg_readwrite_found) {
								//printf("[U] %s %s\n", propagate->instruction->mnemonic, propagate->instruction->op_str);
								//we must handle 3 sub-cases:
								//1) add/sub reg1, imm
								//2) add/sub reg1, reg2 -> to be ignored
								//3) ??? reg1, [reg1]
								//4) ??? reg1, [reg2]
								if(prop_mem_access_found || !is_add_or_sub) {
									//we are in case 3) or 4) -> move the original 'current' before this instruction & in case update the memory values
									if(propagate->prev != current) {
										ListRemove(list, current);
										ListInsertBefore(list, propagate, current);
										optimized = true;
									}
									propagate = NULL;
								} else {
									if(prop_imm_found && is_add_or_sub) {
										//we are in case 1) -> update the immediate value & delete the old instruction
										//printf("[1] prop_readwrite_reg: %s, prop_imm: %llx\n", cs_reg_name(handle, prop_readwrite_reg), prop_imm);
										//update the immediate value
										//printf("prop_imm: 0x%llx\n", prop_imm);
										//printf("current_imm: 0x%llx\n", current_imm);
										//printf("is_curr_add: %d\n", is_curr_add);
										//printf("is_prop_add: %d\n", is_prop_add);
										if(is_curr_add == is_prop_add) {
											prop_imm = current_imm + prop_imm;
										} else {
											if(is_curr_add && !is_prop_add) {
												if(prop_imm > current_imm) {
													sprintf(propagate->instruction->mnemonic, "sub");
													prop_imm = prop_imm - current_imm;
													//printf("HERE1: %llx\n", prop_imm);
												} else {
													sprintf(propagate->instruction->mnemonic, "add");
													prop_imm = current_imm - prop_imm;
													//printf("HERE2: %llx\n", prop_imm);
												}
											} else {
												if(prop_imm > current_imm) {
													sprintf(propagate->instruction->mnemonic, "add");
													prop_imm = prop_imm - current_imm;
													//printf("HERE3: %llx\n", prop_imm);
												} else {
													sprintf(propagate->instruction->mnemonic, "sub");
													prop_imm = current_imm - prop_imm;
													//printf("HERE4: %llx\n", prop_imm);
												}
											}
										}
										/*if(CS_MODE_32) {
											prop_imm = (uint32_t)prop_imm;
										}*/
										//truncate 'prop_imm' as the same size of 'prop_readwrite_reg'
										switch(register_type(prop_readwrite_reg) & 0xF0) {
											case 0x40: {
												prop_imm &= 0xFFFFFFFF;
												break;
											}
											case 0x30: {
												prop_imm &= 0xFFFF;
												break;
											}
											case 0x20: {
												prop_imm &= 0xFF;
												break;
											}
											case 0x10: {
												prop_imm &= 0xFF;
												break;
											}
										}
										//update propagate->instruction
										sprintf(propagate->instruction->op_str, "%s, 0x%llx", cs_reg_name(handle, prop_readwrite_reg), prop_imm);
										//printf("[1] Update add/sub: %s %s\n", propagate->instruction->mnemonic, propagate->instruction->op_str);
										if(!(reassemble(propagate, mode) && update_disasm(propagate, mode))) {
											printf("[-] Error: reassemble() || update_disasm().\n");
										} else {
											//remove 'current' because it was updated
											ListRemove(list, current);
											optimized = true;
											propagate = NULL;
										}
									} else if(!prop_imm_found) {
										propagate = NULL;
									}
								}
							} else if(prop_reg_read_found) {
								//printf("[R] %s %s\n", propagate->instruction->mnemonic, propagate->instruction->op_str);
								//just move the 'current' instruction exactly before the 'propagate' instruction & start a new loop
								/*if(propagate->prev != current) {
									ListRemove(list, current);
									ListInsertBefore(list, propagate, current);
									optimized = true;
								}*/
								propagate = NULL;
							}
						}
						//retrieve next instruction to check
						if(propagate != NULL) {
							propagate = propagate->next;
						}
					}
				}
			}
		}
		//pass to the next instruction
		current = next;
	}
	return optimized;
}

void emulate_code(csh handle, Instruction *start, Instruction *end, Registers *regs, uint8_t mode) {
	//printf("[*] Emulation start...\n");
	//generate the byte array to be emulated
	uint64_t assembly_size = 0;
	Instruction *current = start;
	while(current != end) {
		assembly_size += current->instruction->size;
		current = current->next;
	}
	uint8_t *assembly = calloc(assembly_size, sizeof(uint8_t));
	current = start;
	uint64_t index = 0;
	while(current != NULL && current != end) {
		memcpy((assembly + index), current->instruction->bytes, current->instruction->size);
		index += current->instruction->size;
		current = current->next;
	}
	/*printf("[!] Bytes: \n");
	for(size_t i = 0; i < assembly_size; i++) {
		printf("%02x ", assembly[i]);
	}
	printf("\n");*/
	//setup emulation environment
	uc_engine *uc;
	uc_err err;
	err = uc_open(UC_ARCH_X86, mode, &uc);
	if(err != UC_ERR_OK) {
		printf("[-] Error: uc_open, %s\n", uc_strerror(err));
		return;
	}
	//mapping .text memory, but one should actually allocate every useful piece of memory
	//printf("[*] Allocating: 0x%llx (%d)\n", EMU_SIZE, EMU_SIZE);
	err = uc_mem_map(uc, TEXT_ADDRESS, EMU_SIZE, UC_PROT_ALL);
	if(err != UC_ERR_OK) {
		printf("[-] Error: uc_mem_map, %s\n", uc_strerror(err));
		return;
	}
	//mapping .stack memory (at a standard address, is not really important to be specific)
	err = uc_mem_map(uc, STACK_ADDRESS, EMU_SIZE, UC_PROT_ALL);
	if(err != UC_ERR_OK) {
		printf("[-] Error: uc_mem_map, %s\n", uc_strerror(err));
		return;
	}
	//writing machine code to .text memory
	err = uc_mem_write(uc, TEXT_ADDRESS, assembly, assembly_size);
	if(err != UC_ERR_OK) {
		printf("[-] Error: uc_mem_write, %s\n", uc_strerror(err));
		return;
	}
	//adding hook to trace-step instructions
	//uc_hook hook_id = 0, hook_id_2 = 0;
	//uc_hook_add(uc, &hook_id, UC_HOOK_CODE, hook_code, NULL, TEXT_ADDRESS, TEXT_ADDRESS + assembly_size);
	// intercept invalid memory events
    //uc_hook_add(uc, &hook_id_2, UC_HOOK_MEM_INVALID, hook_mem_invalid, NULL, (uint64_t)1, (uint64_t)0);
	//write registers to emulation context
	switch(mode) {
		case CS_MODE_32:
			uc_reg_write(uc, UC_X86_REG_EAX, &(regs->rax));
			uc_reg_write(uc, UC_X86_REG_EBX, &(regs->rbx));
			uc_reg_write(uc, UC_X86_REG_ECX, &(regs->rcx));
			uc_reg_write(uc, UC_X86_REG_EDX, &(regs->rdx));
			uc_reg_write(uc, UC_X86_REG_ESP, &(regs->rsp));
			uc_reg_write(uc, UC_X86_REG_EBP, &(regs->rbp));
			uc_reg_write(uc, UC_X86_REG_ESI, &(regs->rsi));
			uc_reg_write(uc, UC_X86_REG_EDI, &(regs->rdi));
			break;
		case CS_MODE_64:
			uc_reg_write(uc, UC_X86_REG_RAX, &(regs->rax));
			uc_reg_write(uc, UC_X86_REG_RBX, &(regs->rbx));
			uc_reg_write(uc, UC_X86_REG_RCX, &(regs->rcx));
			uc_reg_write(uc, UC_X86_REG_RDX, &(regs->rdx));
			uc_reg_write(uc, UC_X86_REG_RSP, &(regs->rsp));
			uc_reg_write(uc, UC_X86_REG_RBP, &(regs->rbp));
			uc_reg_write(uc, UC_X86_REG_RSI, &(regs->rsi));
			uc_reg_write(uc, UC_X86_REG_RDI, &(regs->rdi));
			uc_reg_write(uc, UC_X86_REG_R8, &(regs->r8));
			uc_reg_write(uc, UC_X86_REG_R9, &(regs->r9));
			uc_reg_write(uc, UC_X86_REG_R10, &(regs->r10));
			uc_reg_write(uc, UC_X86_REG_R11, &(regs->r11));
			uc_reg_write(uc, UC_X86_REG_R12, &(regs->r12));
			uc_reg_write(uc, UC_X86_REG_R13, &(regs->r13));
			uc_reg_write(uc, UC_X86_REG_R14, &(regs->r14));
			uc_reg_write(uc, UC_X86_REG_R15, &(regs->r15));
			break;
	}
	//emulate code
	uint64_t esp = 0;
	uc_reg_read(uc, UC_X86_REG_ESP, &esp);
	/*printf("[!] Emulating from: 0x%llx\n", TEXT_ADDRESS);
	printf("[!] Stack addre 0x%llx\n", STACK_ADDRESS);
	printf("[!] ESP/RSP addre 0x%llx\n", regs->rsp);
	printf("[!] UC_X86_REG_ESP: 0x%llx\n", esp);*/
	err = uc_emu_start(uc, TEXT_ADDRESS, TEXT_ADDRESS + assembly_size, 0, 0);
	if(err != UC_ERR_OK) {
		printf("[-] Error: uc_emu_start, %s\n", uc_strerror(err));
		return;
	}
	//delete hook
	//uc_hook_del(uc, hook_id);
	//uc_hook_del(uc, hook_id_2);
	//read registers from emulation context
	switch(mode) {
		case CS_MODE_32:
			uc_reg_read(uc, UC_X86_REG_EAX, &(regs->rax));
			uc_reg_read(uc, UC_X86_REG_EBX, &(regs->rbx));
			uc_reg_read(uc, UC_X86_REG_ECX, &(regs->rcx));
			uc_reg_read(uc, UC_X86_REG_EDX, &(regs->rdx));
			uc_reg_read(uc, UC_X86_REG_ESP, &(regs->rsp));
			uc_reg_read(uc, UC_X86_REG_EBP, &(regs->rbp));
			uc_reg_read(uc, UC_X86_REG_ESI, &(regs->rsi));
			uc_reg_read(uc, UC_X86_REG_EDI, &(regs->rdi));
			break;
		case CS_MODE_64:
			uc_reg_read(uc, UC_X86_REG_RAX, &(regs->rax));
			uc_reg_read(uc, UC_X86_REG_RBX, &(regs->rbx));
			uc_reg_read(uc, UC_X86_REG_RCX, &(regs->rcx));
			uc_reg_read(uc, UC_X86_REG_RDX, &(regs->rdx));
			uc_reg_read(uc, UC_X86_REG_RSP, &(regs->rsp));
			uc_reg_read(uc, UC_X86_REG_RBP, &(regs->rbp));
			uc_reg_read(uc, UC_X86_REG_RSI, &(regs->rsi));
			uc_reg_read(uc, UC_X86_REG_RDI, &(regs->rdi));
			uc_reg_read(uc, UC_X86_REG_R8, &(regs->r8));
			uc_reg_read(uc, UC_X86_REG_R9, &(regs->r9));
			uc_reg_read(uc, UC_X86_REG_R10, &(regs->r10));
			uc_reg_read(uc, UC_X86_REG_R11, &(regs->r11));
			uc_reg_read(uc, UC_X86_REG_R12, &(regs->r12));
			uc_reg_read(uc, UC_X86_REG_R13, &(regs->r13));
			uc_reg_read(uc, UC_X86_REG_R14, &(regs->r14));
			uc_reg_read(uc, UC_X86_REG_R15, &(regs->r15));
			break;
	}
	//freeing assembly
	free(assembly);
	//printf("[*] Emulation end...\n");
}

bool emulate_stack_reg(csh handle, List *list, uint8_t mode) {
	//printf("\n ---- [+] emulate_stack_reg [+] ---- \n");
	//little test
	//printf("\n");
	//print_disassembly(handle, list, INFO);
	//printf("\n");
	bool optimized = false;
	Instruction *current = list->first;
	cs_x86 *x86 = NULL;
	cs_x86_op *op;
	size_t op_count = 0;
	uint8_t reg = X86_REG_INVALID;
	bool rsp_change_found;
	while(current != NULL) {
		rsp_change_found = false;
		//check if the instruction is a "mov esp, ????" or "lea esp, ????"
		if(strncmp(current->instruction->mnemonic, "mov", 3) == 0 || strncmp(current->instruction->mnemonic, "lea", 3) == 0) {
			//check if the assigned register is "ESP/RSP"
			x86 = &(current->instruction->detail->x86);
			op_count = x86->op_count;
			for(size_t i = 0; i < op_count; i++) {
				op = &(x86->operands[i]);
				if(op->type == X86_OP_REG && ((op->access == CS_AC_WRITE) || (op->access == (CS_AC_READ|CS_AC_WRITE))) && op->reg != X86_REG_INVALID) {
					if(is_same_register_type(op->reg, X86_REG_RSP)) {
						reg = op->reg;
						rsp_change_found = true;
					}
				}
			}
			//check if an "ESP/RSP" assignation is found
			if(rsp_change_found) {
				//printf("[!] RSP assign: %s %s\n", current->instruction->mnemonic, current->instruction->op_str);
				//we can now emulate the value of ESP/RSP
				Registers *regs = calloc(1, sizeof(Registers));
				//one can actually (and usually must) assign real values to registers, but for now a starting point of "0" is ok
				regs->rsp = STACK_ADDRESS + (STACK_ADDRESS / 2);
				uint64_t old_rsp = regs->rsp;
				//printf("\n[!] BEFORE STACK EMULATION\n");
				//print_disassembly(handle, list, INFO);
				//printf("[+] Emulating the following listing:\n");
				//remove invalid access to memory, delete from the list
				List *sanitized_list = ListCreate();
				Instruction *tmp = list->first;
				Instruction *new_insn;
				cs_x86 *x86_t;
				cs_x86_op *op_t;
				size_t op_count_t;
				while(tmp != current->next) {
					//check if the instruction READ / WRITE the memory (the stack is accepted as valid)
					x86_t = &(tmp->instruction->detail->x86);
					op_count_t = x86->op_count;
					for(size_t i = 0; i < op_count_t; i++) {
						op_t = &(x86_t->operands[i]);
						if(op_t->type == CS_OP_MEM && !is_same_register_type(op_t->mem.base, X86_REG_RSP)) {
							//ignore the instruction
							//printf("[REMOVED MEM ACCESS] %s %s\n", tmp->instruction->mnemonic, tmp->instruction->op_str);
							tmp = tmp->next;
							continue;
						}
					}
					new_insn = (Instruction *)calloc(1, sizeof(Instruction));
					new_insn->instruction = (cs_insn *)calloc(1, sizeof(cs_insn));
					memcpy(new_insn->instruction, tmp->instruction, sizeof(cs_insn));
					ListPush(sanitized_list, new_insn);
					tmp = tmp->next;
				}
				//printf("--------------------------------------------------\n");
				//print_disassembly(handle, sanitized_list, INFO);
				emulate_code(handle, sanitized_list->first, sanitized_list->last->next, regs, mode);
				//emulate_code(handle, list->first, current->next, regs, mode);
				//now ESP/RSP contains the displacement/difference from the starting value of 0
				//evaluate the instruction as "ADD/SUB ESP/RSP, IMM"
				printf("[!] old_rsp: 0x%llx\n", old_rsp);
				printf("[!] new_rsp: 0x%llx\n", regs->rsp);
				uint64_t temp_rsp = 0;
				if(old_rsp > regs->rsp) {
					temp_rsp = old_rsp - regs->rsp;
				} else {
					temp_rsp = regs->rsp - old_rsp;
				}
				//printf("[!] temp_rsp: 0x%llx\n\n", temp_rsp);
				//handle the case where temp_rsp is a 64 bit value
				if((temp_rsp & 0xFFFFFFFF00000000) != 0) {
					//you can have something like this
					//add rsp, 0xFFFFFFFF00000000 -> "add/sub" supports only 32bit immediate, so we have to fix this
					//---------------------------
					//mov qword ptr ss:[rsp-0x800], rax
					//mov rax, 0xFFFFFFFF00000000
					//add rsp, rax
					//mov rax, qword ptr ss:[rsp-0x800]
					cs_insn *mov1 = calloc(1, sizeof(cs_insn));
					cs_insn *mov2 = calloc(1, sizeof(cs_insn));
					cs_insn *mov3 = calloc(1, sizeof(cs_insn));
					cs_insn *real_ins = calloc(1, sizeof(cs_insn));
					sprintf(mov1->mnemonic, "mov");
					sprintf(mov1->op_str, "qword ptr ss:[rsp-0x800], r15");
					sprintf(mov2->mnemonic, "mov");
					sprintf(mov2->op_str, "r15, 0x%llx", temp_rsp);
					if(old_rsp > regs->rsp) {
						sprintf(real_ins->mnemonic, "sub");
					} else {
						sprintf(real_ins->mnemonic, "add");
					}
					sprintf(real_ins->op_str, "rsp, r15");
					sprintf(mov3->mnemonic, "mov");
					sprintf(mov3->op_str, "r15, qword ptr ss:[rsp-0x800]");
					//Instruction *mov1_ins = calloc(1, sizeof(Instruction));
					Instruction *mov2_ins = calloc(1, sizeof(Instruction));
					Instruction *mov3_ins = calloc(1, sizeof(Instruction));
					Instruction *real_ins_ins = calloc(1, sizeof(Instruction));
					mov2_ins->instruction = calloc(1, sizeof(cs_insn));
					mov3_ins->instruction = calloc(1, sizeof(cs_insn));
					real_ins_ins->instruction = calloc(1, sizeof(cs_insn));
					memcpy(current->instruction, mov1, sizeof(cs_insn));
					memcpy(mov2_ins->instruction, mov2, sizeof(cs_insn));
					memcpy(mov3_ins->instruction, mov3, sizeof(cs_insn));
					memcpy(real_ins_ins->instruction, real_ins, sizeof(cs_insn));
					if(!(reassemble(current, mode) && update_disasm(current, mode))) {
						printf("[-] Error: reassemble() || update_disasm().\n");
						//return false;
					}
					if(!(reassemble(mov2_ins, mode) && update_disasm(mov2_ins, mode))) {
						printf("[-] Error: reassemble() || update_disasm().\n");
						//return false;
					}
					if(!(reassemble(mov3_ins, mode) && update_disasm(mov3_ins, mode))) {
						printf("[-] Error: reassemble() || update_disasm().\n");
						//return false;
					}
					if(!(reassemble(real_ins_ins, mode) && update_disasm(real_ins_ins, mode))) {
						printf("[-] Error: reassemble() || update_disasm().\n");
						//return false;
					}
					ListInsertAfter(list, current, mov2_ins);
					ListInsertAfter(list, mov2_ins, real_ins_ins);
					ListInsertAfter(list, real_ins_ins, mov3_ins);
				} else {
					if(temp_rsp == 0) {
						/*printf("[!] Prev: %s %s\n", current->prev->instruction->mnemonic, current->prev->instruction->op_str);
						printf("[!] Removed: %s %s\n", current->instruction->mnemonic, current->instruction->op_str);
						printf("[!] Next: %s %s\n", current->next->instruction->mnemonic, current->next->instruction->op_str);*/
						ListRemove(list, current);
						/*printf("-------------------TEST---------------------\n");
						print_disassembly(handle, list, INFO);
						printf("-------------------TEST---------------------\n");*/
					} else {
						//add 4/8 for each pop, sub 4/8 for each push
						Instruction *temp = list->first;
						while(temp != current) {
							if(strncmp(temp->instruction->mnemonic, "push", 4) == 0) {
								temp_rsp = (mode == CS_MODE_32) ? temp_rsp - 4 : temp_rsp - 8;
							} else if(strncmp(temp->instruction->mnemonic, "pop", 3) == 0) {
								temp_rsp = (mode == CS_MODE_32) ? temp_rsp + 4 : temp_rsp + 8;
							}
							temp = temp->next;
						}
						//creating new instruction
						if(old_rsp > regs->rsp) {
							sprintf(current->instruction->mnemonic, "sub");
							sprintf(current->instruction->op_str, "%s, 0x%llx", cs_reg_name(handle, reg), temp_rsp);
						} else {
							sprintf(current->instruction->mnemonic, "add");
							sprintf(current->instruction->op_str, "%s, 0x%llx", cs_reg_name(handle, reg), temp_rsp);
						}
						//replace old instruction
						//printf("[+] updating RSP: %s %s\n", current->instruction->mnemonic, current->instruction->op_str);
						if(!(reassemble(current, mode) && update_disasm(current, mode))) {	
							printf("[-] Error: reassemble() || update_disasm().\n");
							//return false;
						} else {
							//printf("[!] temp_rsp: %llx\n", temp_rsp);
							if(temp_rsp == 0) {
								//printf("[!] Removed: %s %s\n", current->instruction->mnemonic, current->instruction->op_str);
								ListRemove(list, current);
								/*printf("-------------------TEST---------------------\n");
								print_disassembly(handle, list, INFO);
								printf("-------------------TEST---------------------\n");*/
							} else {
								//printf("\n\n[!] New instruction (ESP): %s %s\n\n\n", current->instruction->mnemonic, current->instruction->op_str);
								//current = stack_reg_assign;
								//stack_reg_assign = NULL;
								//printf("\nOPTIMIZED----------------------------------------------------\n");
								//print_disassembly(handle, list, INFO);
								//printf("\nOPTIMIZED----------------------------------------------------\n");
								optimized = true;
								free(regs);
								collapse_add_sub(handle, list, MODE, true);
								//printf("\nCOLLAPSED----------------------------------------------------\n");
								//print_disassembly(handle, list, INFO);
								//printf("\nCOLLAPSED----------------------------------------------------\n");
							}
						}
					}
				}
				ListDestroy(sanitized_list);
			}
		}
		//going to next instruction
		current = current->next;
	}
	//once finished move the "add/sub esp/rsp, imm" to the very end of the code
	current = list->first;
	while(current != NULL) {
		//check if the instruction is a "add/sub esp/rsp, imm"
		if(strncmp(current->instruction->mnemonic, "sub", 3) == 0 || strncmp(current->instruction->mnemonic, "add", 3) == 0) {
			//checking if there is a register: esp/rsp
			cs_x86 *x86 = &(current->instruction->detail->x86);
			size_t op_count = x86->op_count;
			bool imm_found = false;
			bool stack_reg_found = false;
			for(size_t i = 0; i < op_count; i++) {
				op = &(x86->operands[i]);
				if(op->type == X86_OP_IMM) {
					imm_found = true;
				}
				if(op->type == X86_OP_REG && ((op->access == CS_AC_WRITE) || (op->access == (CS_AC_READ|CS_AC_WRITE))) && is_same_register_type(op->reg, X86_REG_RSP)) {
					stack_reg_found = true;
				}
			}
			if(imm_found && stack_reg_found) {
				//printf("[!] Moved to the end: %s %s\n", current->instruction->mnemonic, current->instruction->op_str);
				//move instruction to the very end
				ListRemove(list, current);
				ListInsertAfter(list, list->last, current);
				//end loop
				current = NULL;
				//optimized = true;
			}
		}
		if(current != NULL) {
			//check next instruction
			current = current->next;
		}
	}
	//little test
	//printf("\n");
	//print_disassembly(handle, list, INFO);
	//printf("\n");
	return optimized;
}

