bool code_reordering(csh handle, List *list, Instruction *start, Instruction *end) {
	bool optimized = false;
	Instruction *current = start, *next;
	cs_x86 *x86;
	cs_x86_op *op;
	size_t op_count;
	while(current != NULL && current != end) {
		next = current->next;
		printf("[+] Reorder: %s %s\n", current->instruction->mnemonic, current->instruction->op_str);
		//check if the instruction doesn't use a memory location as destination
		x86 = &(current->instruction->detail->x86);
		op_count = x86->op_count;
		uint8_t src_reg = X86_REG_INVALID, dst_reg = X86_REG_INVALID;
		uint8_t base_reg = X86_REG_INVALID, index_reg = X86_REG_INVALID;
		bool memory_involved = false;
		for(size_t i = 0; i < op_count && !memory_involved; i++) {
			op = &(x86->operands[i]);
			if(op->type == X86_OP_MEM) {
				if(op->access == CS_AC_WRITE || op->access == (CS_AC_READ|CS_AC_WRITE)) {
					//a memory location is changed/written, ignore this instruction
					memory_involved = true;
				} else {
					//a memory location is read, save the registers base & index
					base_reg = op->mem.base;
					index_reg = op->mem.index;
					//for now disable memory READ reordering
					memory_involved = true;
				}
			} else if(op->type == X86_OP_REG) {
				//save the accessed registers
				if(op->access == (CS_AC_READ|CS_AC_WRITE)) {
					if(dst_reg == X86_REG_INVALID) {
						dst_reg = op->reg;
					} else if(src_reg == X86_REG_INVALID) {
						src_reg = op->reg;
					}
				} else if(op->access == CS_AC_READ) {
					src_reg = op->reg;
				} else if(op->access == CS_AC_WRITE) {
					dst_reg = op->reg;
				}
			}
		}
		//check if an instruction involving memory is found and in case jump to the next instruction
		if(memory_involved) {
			current = next;
			continue;
		}
		//printf("[+] src_reg = %s, dst_reg = %s\n", cs_reg_name(handle, src_reg), cs_reg_name(handle, dst_reg));
		//printf("[+] base_reg = %s, index_reg = %s\n", cs_reg_name(handle, base_reg), cs_reg_name(handle, index_reg));
		//move down the instruction, until a register involved in the original instruction is used
		Instruction *temp = next;
		while(temp != NULL && temp != end) {
			//check if src_reg/dst_reg/base_reg/index_reg are used in the 'temp' instruction
			x86 = &(temp->instruction->detail->x86);
			op_count = x86->op_count;
			bool end_instruction_found = false;
			uint8_t src_tmp_reg = X86_REG_INVALID, dst_tmp_reg = X86_REG_INVALID;
			uint8_t base_tmp_reg = X86_REG_INVALID, index_tmp_reg = X86_REG_INVALID;
			for(size_t i = 0; i < op_count; i++) {
				op = &(x86->operands[i]);
				if(op->type == X86_OP_REG) {
					//check registers used as source/destination
					if((src_reg != X86_REG_INVALID && is_same_register_type(op->reg, src_reg)) || (dst_reg != X86_REG_INVALID && is_same_register_type(op->reg, dst_reg))) {
						//printf("[!] FOUND [(%s)%d] == [(%s)%d]\n", cs_reg_name(handle, op->reg), register_type(op->reg) & 0xF, cs_reg_name(handle, src_reg), register_type(src_reg) & 0xF);
						//printf("[!] FOUND [(%s)%d] == [(%s)%d]\n", cs_reg_name(handle, op->reg), register_type(op->reg) & 0xF, cs_reg_name(handle, dst_reg), register_type(dst_reg) & 0xF);
						end_instruction_found = true;
						//little check for AH/AL and similar
						uint8_t src_reg_code = register_type(src_reg) & 0xF0;
						uint8_t dst_reg_code = register_type(dst_reg) & 0xF0;
						uint8_t op_reg_code = register_type(op->reg) & 0xF0;
						if((src_reg_code == 0x20 && op_reg_code == 0x10) || (src_reg_code == 0x10 && op_reg_code == 0x20)) {
							end_instruction_found = false;
						}
						if((dst_reg_code == 0x20 && op_reg_code == 0x10) || (dst_reg_code == 0x10 && op_reg_code == 0x20)) {
							end_instruction_found = false;
						}
					}
					//check registers used as base/index
					if((base_reg != X86_REG_INVALID && is_same_register_type(op->reg, base_reg)) || (index_reg != X86_REG_INVALID && is_same_register_type(op->reg, index_reg))) {
						//printf("[!] FOUND [(%s)%d] == [(%s)%d]\n", cs_reg_name(handle, op->reg), register_type(op->reg) & 0xF, cs_reg_name(handle, base_reg), register_type(base_reg) & 0xF);
						//printf("[!] FOUND [(%s)%d] == [(%s)%d]\n", cs_reg_name(handle, op->reg), register_type(op->reg) & 0xF, cs_reg_name(handle, index_reg), register_type(index_reg) & 0xF);
						end_instruction_found = true;
						//little check for AH/AL and similar
						uint8_t base_reg_code = register_type(base_reg) & 0xF0;
						uint8_t index_reg_code = register_type(index_reg) & 0xF0;
						uint8_t op_reg_code = register_type(op->reg) & 0xF0;
						if((base_reg_code == 0x20 && op_reg_code == 0x10) || (base_reg_code == 0x10 && op_reg_code == 0x20)) {
							end_instruction_found = false;
						}
						if((index_reg_code == 0x20 && op_reg_code == 0x10) || (index_reg_code == 0x10 && op_reg_code == 0x20)) {
							end_instruction_found = false;
						}
					}
					//save temporary accessed registers
					if(op->access == (CS_AC_READ|CS_AC_WRITE)) {
						if(dst_tmp_reg == X86_REG_INVALID) {
							dst_tmp_reg = op->reg;
						} else if(src_reg == X86_REG_INVALID) {
							src_tmp_reg = op->reg;
						}
					} else if(op->access == CS_AC_READ) {
						src_tmp_reg = op->reg;
					} else if(op->access == CS_AC_WRITE) {
						dst_tmp_reg = op->reg;
					}
				} else if(op->type == X86_OP_MEM) {
					//check registers used as source/destination
					if(/*(src_reg != X86_REG_INVALID && op->mem.base != X86_REG_INVALID && is_same_register_type(op->mem.base, src_reg)) || */(dst_reg != X86_REG_INVALID && op->mem.base != X86_REG_INVALID && is_same_register_type(op->mem.base, dst_reg))) {
						//printf("[!] FOUND [(%s)%d] == [(%s)%d]\n", cs_reg_name(handle, op->mem.base), register_type(op->mem.base) & 0xF, cs_reg_name(handle, src_reg), register_type(src_reg) & 0xF);
						//printf("[!] FOUND [(%s)%d] == [(%s)%d]\n", cs_reg_name(handle, op->mem.base), register_type(op->mem.base) & 0xF, cs_reg_name(handle, dst_reg), register_type(dst_reg) & 0xF);
						base_tmp_reg = op->mem.base;
						end_instruction_found = true;
					}
					if(/*(src_reg != X86_REG_INVALID && op->mem.index != X86_REG_INVALID && is_same_register_type(op->mem.index, src_reg)) || */(dst_reg != X86_REG_INVALID && op->mem.index != X86_REG_INVALID && is_same_register_type(op->mem.index, dst_reg))) {
						//printf("[!] FOUND [(%s)%d] == [(%s)%d]\n", cs_reg_name(handle, op->mem.index), register_type(op->mem.index) & 0xF, cs_reg_name(handle, src_reg), register_type(src_reg) & 0xF);
						//printf("[!] FOUND [(%s)%d] == [(%s)%d]\n", cs_reg_name(handle, op->mem.index), register_type(op->mem.index) & 0xF, cs_reg_name(handle, dst_reg), register_type(dst_reg) & 0xF);
						index_tmp_reg = op->mem.index;
						end_instruction_found = true;
					}
					base_tmp_reg = op->mem.base;
					index_tmp_reg = op->mem.index;
					/*if(op->access == CS_AC_READ) {
						//check registers used as base/index
						if((base_reg != X86_REG_INVALID && op->mem.base != X86_REG_INVALID && is_same_register_type(op->mem.base, base_reg)) || (index_reg != X86_REG_INVALID && op->mem.base != X86_REG_INVALID && is_same_register_type(op->mem.base, index_reg))) {
							//printf("[!] FOUND [(%s)%d] == [(%s)%d]\n", cs_reg_name(handle, op->mem.base), register_type(op->mem.base) & 0xF, cs_reg_name(handle, base_reg), register_type(base_reg) & 0xF);
							//printf("[!] FOUND [(%s)%d] == [(%s)%d]\n", cs_reg_name(handle, op->mem.base), register_type(op->mem.base) & 0xF, cs_reg_name(handle, index_reg), register_type(index_reg) & 0xF);
							base_tmp_reg = op->mem.base;
							end_instruction_found = true;
						}
						if((base_reg != X86_REG_INVALID && op->mem.index != X86_REG_INVALID && is_same_register_type(op->mem.index, base_reg)) || (index_reg != X86_REG_INVALID && op->mem.index != X86_REG_INVALID && is_same_register_type(op->mem.index, index_reg))) {
							//printf("[!] FOUND [(%s)%d] == [(%s)%d]\n", cs_reg_name(handle, op->mem.index), register_type(op->mem.index) & 0xF, cs_reg_name(handle, base_reg), register_type(base_reg) & 0xF);
							//printf("[!] FOUND [(%s)%d] == [(%s)%d]\n", cs_reg_name(handle, op->mem.index), register_type(op->mem.index) & 0xF, cs_reg_name(handle, index_reg), register_type(index_reg) & 0xF);
							index_tmp_reg = op->mem.index;
							end_instruction_found = true;
						}
					}*/
				}
			}
			//check if src_reg or dst_reg are used
			if(end_instruction_found) {
				//check if the 'current' & 'temp' instructions are already consecutive -> no need to move 'current'
				if(temp != next) {
					//we need to search for the first instruction (before 'temp') that is not using 'temp' registers
					//when we find it, place the 'current' instruction after it
					Instruction *loop_back = temp->prev;
					Instruction *old_moved;
					printf("[+] src_tmp_reg = %s, dst_tmp_reg = %s\n", cs_reg_name(handle, src_tmp_reg), cs_reg_name(handle, dst_tmp_reg));
					printf("[+] base_tmp_reg = %s, index_tmp_reg = %s\n", cs_reg_name(handle, base_tmp_reg), cs_reg_name(handle, index_tmp_reg));
					printf("current: %s %s\n", current->instruction->mnemonic, current->instruction->op_str);
					printf("temp: %s %s\n", temp->instruction->mnemonic, temp->instruction->op_str);
					printf("loop_back: %s %s\n", loop_back->instruction->mnemonic, loop_back->instruction->op_str);
					bool using_regs = false;
					while(loop_back != current) {
						x86 = &(loop_back->instruction->detail->x86);
						op_count = x86->op_count;
						//printf("[!] Checking: %s %s\n", loop_back->instruction->mnemonic, loop_back->instruction->op_str);
						for(size_t i = 0; i < op_count; i++) {
							op = &(x86->operands[i]);
							if(op->type == X86_OP_REG) {
								if((src_tmp_reg != X86_REG_INVALID && op->reg != X86_REG_INVALID && is_same_register_type(src_tmp_reg, op->reg))) {
									using_regs = true;
									//little check for AH/AL and similar
									uint8_t reg_code = register_type(src_tmp_reg) & 0xF0;
									uint8_t op_reg_code = register_type(op->reg) & 0xF0;
									if((reg_code == 0x20 && op_reg_code == 0x10) || (reg_code == 0x10 && op_reg_code == 0x20)) {
										using_regs = false;
									}
								}
								if((dst_tmp_reg != X86_REG_INVALID && op->reg != X86_REG_INVALID && is_same_register_type(dst_tmp_reg, op->reg))) {
									using_regs = true;
									//little check for AH/AL and similar
									uint8_t reg_code = register_type(dst_tmp_reg) & 0xF0;
									uint8_t op_reg_code = register_type(op->reg) & 0xF0;
									if((reg_code == 0x20 && op_reg_code == 0x10) || (reg_code == 0x10 && op_reg_code == 0x20)) {
										using_regs = false;
									}
								}
								if((base_tmp_reg != X86_REG_INVALID && op->reg != X86_REG_INVALID && is_same_register_type(base_tmp_reg, op->reg))) {
									using_regs = true;
									//little check for AH/AL and similar
									uint8_t reg_code = register_type(base_tmp_reg) & 0xF0;
									uint8_t op_reg_code = register_type(op->reg) & 0xF0;
									if((reg_code == 0x20 && op_reg_code == 0x10) || (reg_code == 0x10 && op_reg_code == 0x20)) {
										using_regs = false;
									}
								}
								if((index_tmp_reg != X86_REG_INVALID && op->reg != X86_REG_INVALID && is_same_register_type(index_tmp_reg, op->reg))) {
									using_regs = true;
									//little check for AH/AL and similar
									uint8_t reg_code = register_type(index_tmp_reg) & 0xF0;
									uint8_t op_reg_code = register_type(op->reg) & 0xF0;
									if((reg_code == 0x20 && op_reg_code == 0x10) || (reg_code == 0x10 && op_reg_code == 0x20)) {
										using_regs = false;
									}
								}
							}
						}
						if(using_regs) {
							loop_back = loop_back->prev;
							using_regs = false;
							continue;
						} else {
							if(old_moved) {
								//printf(">>> old_moved: %s %s\n", old_moved->instruction->mnemonic, old_moved->instruction->op_str);
								//printf(">>> loop_back: %s %s\n", loop_back->instruction->mnemonic, loop_back->instruction->op_str);
								optimized = false;
							}
							if(old_moved != loop_back) {
								printf("[!] Moving: (%s %s) after (%s %s)\n", current->instruction->mnemonic, current->instruction->op_str, loop_back->instruction->mnemonic, loop_back->instruction->op_str);
								ListRemove(list, current);
								ListInsertAfter(list, loop_back, current);
								//print_disassembly(handle, list, INFO);
								optimized = true;
								//printf(">>>>>> old_moved: %s %s\n", old_moved->instruction->mnemonic, old_moved->instruction->op_str);
								old_moved = current;
								//printf(">>>>>> old_moved: %s %s\n", old_moved->instruction->mnemonic, old_moved->instruction->op_str);
								//printf(">>>>>> loop_back: %s %s\n", loop_back->instruction->mnemonic, loop_back->instruction->op_str);
							}
							loop_back = current;
						}
					}
				}
				//end the inner cycle
				temp = NULL;
			} else {
				temp = temp->next;
			}
		}
		current = next;
	}
	return optimized;
}

bool propagate_register(csh handle, List *list, uint8_t mode) {
	bool optimized = false;
	Instruction *current = list->first, *next = NULL;
	//capstone pointers & vars
	cs_x86 *x86;
	cs_x86_op *op;
	size_t op_count;
	//useful flags & vars
	uint8_t dst_reg, src_reg;
	uint64_t src_imm = 0;
	while(current != NULL) {
		next = current->next;
		if(current->invalid) {
			current = next;
			continue;
		}
		//check if the instruction is "mov reg1, reg2/imm" (not supporting memory as source for now)
		if(strncmp(current->instruction->mnemonic, "mov", 3) == 0) {
			dst_reg = X86_REG_INVALID;
			src_reg = X86_REG_INVALID;
			src_imm = 0;
			x86 = &(current->instruction->detail->x86);
			op_count = x86->op_count;
			for(size_t i = 0; i < op_count; i++) {
				op = &(x86->operands[i]);
				if(op->type == X86_OP_REG) {
					if(op->access == CS_AC_WRITE) {
						dst_reg = op->reg;
					} else if(op->access == CS_AC_READ) {
						src_reg = op->reg;
					}
				} else if(op->type == X86_OP_IMM) {
					src_imm = op->imm;
				}
			}
			//check if the instruction is compatible (a destination register was found)
			if(dst_reg != X86_REG_INVALID) {
				printf("[+] Register write instruction: %s %s\n", current->instruction->mnemonic, current->instruction->op_str);
				//propagate dst_reg until:
				//1) dst_reg is changed
				//2) src_reg is changed
				Instruction *temp = current->next, *temp_next = NULL;
				//useful flags
				bool reg_changed;
				bool reg_read;
				bool is_dst_reg;
				bool is_dst_mem;
				//useful vars
				uint8_t src_tmp_reg;
				uint8_t dst_tmp_reg;
				uint8_t base_tmp_reg;
				uint8_t index_tmp_reg;
				uint64_t scale_tmp;
				uint64_t disp_tmp;
				while(temp != NULL) {
					temp_next = temp->next;
					printf("[+] Checking: %s %s\n", temp->instruction->mnemonic, temp->instruction->op_str);
					//extract information from the instruction
					x86 = &(temp->instruction->detail->x86);
					op_count = x86->op_count;
					//reset flags
					reg_changed = false;
					reg_read = false;
					is_dst_reg = false;
					is_dst_mem = false;
					src_tmp_reg = X86_REG_INVALID;
					for(size_t i = 0; i < op_count; i++) {
						op = &(x86->operands[i]);
						if(op->type == X86_OP_REG) {
							if(op->access == CS_AC_WRITE || op->access == (CS_AC_WRITE|CS_AC_READ)) {
								//check if dst_reg is overwrite
								if(is_same_register_type(dst_reg, op->reg)) {
									reg_changed = true;
								}
								//check if src_reg was overwrite
								if(src_reg != X86_REG_INVALID && is_same_register_type(src_reg, op->reg)) {
									reg_changed = true;
								}
								//save the destination register
								is_dst_reg = true;
								dst_tmp_reg = op->reg;
							} else {
								//the instruction is reading a register, check if it is dst_reg
								if(is_same_register_type(dst_reg, op->reg)) {
									src_tmp_reg = op->reg;
									reg_read = true;
								}
							}
						} else if(op->type == X86_OP_MEM && (op->access == CS_AC_WRITE || op->access == (CS_AC_WRITE|CS_AC_READ))) {
							//save destination memory
							is_dst_mem = true;
							base_tmp_reg = op->mem.base;
							index_tmp_reg = op->mem.index;
							scale_tmp = op->mem.scale;
							disp_tmp = op->mem.disp;
						}
					}
					//check if reg_changed & reg_read, for example:
					//mov reg1_small, reg2_small
					//mov reg1_big, reg1_small
					if(reg_changed && reg_read && is_same_register_type(dst_tmp_reg, dst_reg)) {
						if(src_reg != X86_REG_INVALID) {
							printf("[+] New instruction: %s %s, %s\n", temp->instruction->mnemonic, cs_reg_name(handle, dst_tmp_reg), cs_reg_name(handle, src_reg));
						} else {
							printf("[+] New instruction: %s %s, 0x%llx\n", temp->instruction->mnemonic, cs_reg_name(handle, dst_tmp_reg), src_imm);
						}
					}
					//check if src_reg/dst_reg is changed
					if(reg_changed) {
						temp = NULL;
						continue;
					}
					//check if a valid instruction was found
					if(reg_read) {
						printf("[+] Register read instruction: %s %s\n", temp->instruction->mnemonic, temp->instruction->op_str);
						//update the instruction with the right substitution (src_reg or src_imm)
						char source[30] = { 0 };
						if(src_reg != X86_REG_INVALID) {
							//the original source was a register, propagate it
							sprintf(source, cs_reg_name(handle, src_reg));
						} else {
							//the original source was an immediate, propagate is, but remember to scale it
							switch(register_type(src_tmp_reg) & 0xF0) {
								case 0x40:
									src_imm &= 0xFFFFFFFF;
									break;
								case 0x30:
									src_imm &= 0xFFFF;
									break;
								case 0x20:
								case 0x10:
									src_imm &= 0xFF;
							}
							sprintf(source, "0x%llx", src_imm);
						}
						Instruction *new_insn = calloc(1, sizeof(Instruction));
						new_insn->instruction = calloc(1, sizeof(cs_insn));
						//copy the original mnemonic
						sprintf(new_insn->instruction->mnemonic, temp->instruction->mnemonic);
						if(is_dst_reg) {
							//the destination is a register
							sprintf(new_insn->instruction->op_str, "%s, %s", cs_reg_name(handle, dst_tmp_reg), source);
						} else {
							//the destination is a memory location
							sprintf(new_insn->instruction->op_str, "[%s + %s*0x%llx + 0x%llx], %s", cs_reg_name(handle, base_tmp_reg), cs_reg_name(handle, index_tmp_reg), scale_tmp, disp_tmp, source);
						}
						printf("[+] New instruction: %s %s\n", new_insn->instruction->mnemonic, new_insn->instruction->op_str);
					}
					temp = temp_next;
				}
			}
		}
		current = next;
	}
	return optimized;
}

bool propagate_memory(csh handle, List *list, uint8_t mode) {
	bool optimized = false;
	Instruction *current = list->first, *next = NULL;
	//capstone pointers & vars
	cs_x86 *x86;
	cs_x86_op *op;
	size_t op_count;
	//memory vars
	uint8_t base, index;
	uint64_t scale, disp;
	uint8_t src_reg;
	uint64_t src_imm;
	//useful flags
	bool memory_ins_found;
	while(current != NULL) {
		next = current->next;
		//ignore invalid instructions
		if(current->invalid) {
			current = next;
			continue;
		}
		memory_ins_found = false;
		//check if the instruction is "mov [base+index*scale+displacement], reg/imm"
		x86 = &(current->instruction->detail->x86);
		op_count = x86->op_count;
		//reset vars
		src_reg = X86_REG_INVALID;
		src_imm = 0;
		base = X86_REG_INVALID;
		index = X86_REG_INVALID;
		scale = 0;
		disp = 0;
		for(size_t i = 0; i < op_count; i++) {
			op = &(x86->operands[i]);
			if(op->type == X86_OP_MEM && op->access == CS_AC_WRITE) {
				base = op->mem.base;
				index = op->mem.index;
				scale = op->mem.scale;
				disp = op->mem.disp;
				//mark the instruction as found
				memory_ins_found = true;
			} else {
				if(op->type == X86_OP_REG) {
					src_reg = op->reg;
				} else {
					src_imm = op->imm;
				}
			}
		}
		//check if a memory write instruction was found
		if(strncmp(current->instruction->mnemonic, "mov", 3) == 0 && memory_ins_found) {
			printf("[+] Memory write instruction: %s %s\n", current->instruction->mnemonic, current->instruction->op_str);
			//propagate the src_imm or src_reg until:
			//1) base/index register changes
			//2) src_reg is modified
			//3) another write to the same memory location is found
			Instruction *temp = next, *tmp_next;
			//useful flags
			uint8_t dst_reg;
			bool register_changed;
			bool memory_overwrite;
			bool memory_source_found;
			while(temp != NULL) {
				tmp_next = temp->next;
				//printf("[!] Checking: %s %s\n", temp->instruction->mnemonic, temp->instruction->op_str);
				//extract information from the instruction
				x86 = &(temp->instruction->detail->x86);
				op_count = x86->op_count;
				//reset flags
				register_changed = false;
				memory_overwrite = false;
				memory_source_found = false;
				for(size_t i = 0; i < op_count; i++) {
					op = &(x86->operands[i]);
					if(op->type == X86_OP_REG && (op->access == CS_AC_WRITE || op->access == (CS_AC_WRITE|CS_AC_READ))) {
						//save current written register
						dst_reg = op->reg;
						//check if base/index/src_reg is changed
						if(src_reg != X86_REG_INVALID && is_same_register_type(op->reg, src_reg)) {
							//the source register is modified
							register_changed = true;
						}
						if(base != X86_REG_INVALID && is_same_register_type(op->reg, base)) {
							//the base register is modified
							register_changed = true;
						}
						if(index != X86_REG_INVALID && is_same_register_type(op->reg, index)) {
							//the index register is modified
							register_changed = true;
						}
					} else if(op->type == X86_OP_MEM) {
						//check if a new value is written to the same memory location
						if(is_same_register_type(op->mem.base, base) && is_same_register_type(op->mem.index, index) && op->mem.scale == scale && op->mem.disp == disp) {
							if(op->access == CS_AC_WRITE || op->access == (CS_AC_WRITE|CS_AC_READ)) {
								memory_overwrite = true;
							} else {
								memory_source_found = true;
							}
						}
					}
				}
				//check if register is overwritten & memory is read, for example:
				//mov [mem], reg1
				//mov reg1, [mem]
				if(register_changed && memory_source_found) {
					ListRemove(list, current);
					ListRemove(list, temp);
					optimized = true;
				}
				//check if registers changed or memory was overwrite
				if(!register_changed && !memory_overwrite) {
					//check if the same memory location is used as source and the instruction is not "lea"
					if(memory_source_found && strncmp(temp->instruction->mnemonic, "lea", 3) != 0) {
						//an instruction of the type: "mov reg, [base+index*scale+displacement]" was found
						//create a new instruction of the type: "mov reg, src_reg/src_imm"
						if(!temp->invalid) {
							printf("[+] Memory read instruction: %s %s\n", temp->instruction->mnemonic, temp->instruction->op_str);
							//printf("[+] New instruction: %s %s, %s\n", temp->instruction->mnemonic, cs_reg_name(handle, dst_reg), cs_reg_name(handle, src_reg));
							Instruction *new_insn = calloc(1, sizeof(Instruction));
							new_insn->instruction = calloc(1, sizeof(cs_insn));
							sprintf(new_insn->instruction->mnemonic, temp->instruction->mnemonic);
							if(src_reg != X86_REG_INVALID) {
								sprintf(new_insn->instruction->op_str, "%s, %s", cs_reg_name(handle, dst_reg), cs_reg_name(handle, src_reg));
							} else {
								sprintf(new_insn->instruction->op_str, "%s, 0x%llx", cs_reg_name(handle, dst_reg), src_imm);
							}
							if(!(reassemble(new_insn, mode) && update_disasm(new_insn, mode))) {
								printf("[-] Error: reassemble() or update_disasm()\n");
							} else {
								//remove the old 'temp' instruction
								printf("[+] New instruction: %s %s\n", new_insn->instruction->mnemonic, new_insn->instruction->op_str);
								ListInsertAfter(list, temp, new_insn);
								ListRemove(list, temp);
								optimized = true;
							}
						}
					}
					//continue propagating
					temp = tmp_next;
				} else {
					//stop the propagation here
					temp = NULL;
				}
			}
		}
		current = next;
	}
	return optimized;
}

