int main() {
	/* Importing XEDParseAssemble from the dynamic library */
	HANDLE XEDLib = LoadLibrary("XEDParse.dll");
	if(XEDLib == NULL) {
		printf("[-] Error: LoadLibrary - 0x%x\n", GetLastError());
		return EXIT_FAILURE;
	}
	assemble = (XEDParseAssemble)GetProcAddress(XEDLib, "XEDParseAssemble");
	if(assemble == NULL) {
		printf("[-] Error: GetProcAddress - 0x%x\n", GetLastError());
		return EXIT_FAILURE;
	}
	/* Optimizing for stack operations */
	csh handle;
	cs_insn *insn;
	cs_err err;
	size_t count;
	err = cs_open(CS_ARCH_X86, MODE, &handle);
	if(err != CS_ERR_OK) {
		printf("[-] Error: cs_open.\n");
		return -1;
	}
	//I want all possible details
	cs_option(handle, CS_OPT_DETAIL, CS_OPT_ON);
	count = cs_disasm(handle, CODE, sizeof(CODE)-1, 0x1000, 0, &insn);
	if(count > 0) {
		//create list
		list = ListCreate();
		//adding original instructions to list
		Instruction *current = NULL;
		for(size_t i = 0; i < count; i++) {
			current = calloc(1, sizeof(Instruction));
			current->instruction = (cs_insn *)calloc(1, sizeof(cs_insn));
			memcpy(current->instruction, &insn[i], sizeof(cs_insn));
			ListPush(list, current);
		}
		printf("------------ Initial state ------------\n\n");
		print_disassembly(handle, list, INFO);
		printf("\n\n\n\n\n\n");
		bool optimized = false;
		//first pass
		if(FIRST_PASS) {
			do {
				optimized = false;
				while(peephole_optimize(handle, list, MODE)) {
					//printf("\n\n------------ Little peephole optimizations ------------\n\n");
					optimized = true;
				}
				while(expand_stack_ins(handle, list, MODE)) {
					//printf("\n\n------------ Expanding stack instructions ------------\n\n");
					optimized = true;
				}
				//printf("TEMP: after expand_stack_ins\n\n");
				//print_disassembly(handle, list, INFO);
				while(eliminate_junk(handle, list, MODE)) {
					//printf("\n\n------------ Junk code elimination ------------\n\n");
					optimized = true;
				}
				//printf("TEMP: after eliminate_junk\n\n");
				//print_disassembly(handle, list, INFO);
				while(collapse_add_sub(handle, list, MODE, false)) {
					//printf("\n\n------------ Collapsing sub/add instructions ------------\n\n");
					optimized = true;
				}
				//printf("TEMP: after collapse_add_sub\n\n");
				//print_disassembly(handle, list, INFO);
				while(emulate_stack_reg(handle, list, MODE)) {
					//printf("\n\n------------ Emulating ESP/RSP registers ------------\n\n");
					optimized = true;
				}
				//printf("TEMP: after emulate_stack_reg\n\n");
				//print_disassembly(handle, list, INFO);
				while(eliminate_code(handle, list, MODE)) {
					//printf("\n\n------------ Dead code elimination ------------\n\n");
					optimized = true;
				}
				//printf("TEMP: after eliminate_code\n\n");
				//print_disassembly(handle, list, INFO);
				//NEED TO REDEFINE HOW IT WORKS
				while(propagate_constant(handle, list, MODE)) {
					//printf("\n\n------------ Propagating constants ------------\n\n");
					optimized = true;
				}
				//printf("TEMP: after propagate_constant\n\n");
				//print_disassembly(handle, list, INFO);
				while(eliminate_junk(handle, list, MODE)) {
					//printf("\n\n------------ Junk code elimination ------------\n\n");
					optimized = true;
				}
				//printf("TEMP: after arithmetic_stack_propagation\n\n");
				//print_disassembly(handle, list, INFO);
				//RUNNING OUT OF MEMORY
				while(arithmetic_propagation(handle, list, MODE, false)) {
					//printf("\n\n------------ Arithmetic propagation ------------\n\n");
					optimized = true;
				}
				/*printf("TEMP: after arithmetic_propagation\n\n");
				print_disassembly(handle, list, INFO);
				while(code_reordering(handle, list, list->first, list->last)) {
					optimized = true;
				}*/
				//printf("TEMP: before propagate_memory\n\n");
				//print_disassembly(handle, list, INFO);
				while(propagate_memory(handle, list, MODE)) {
					optimized = true;
				}
				printf("TEMP: after propagate_memory\n\n");
				print_disassembly(handle, list, INFO);
				while(propagate_register(handle, list, MODE)) {
					optimized = true;
				}
			} while(optimized);
		}
		printf("TEMP: before code_reordering\n\n");
		print_disassembly(handle, list, INFO);
		do {
			optimized = false;
			while(code_reordering(handle, list, list->first, list->last)) {
				optimized = true;
			}
		} while(optimized);
		//second pass
		if(SECOND_PASS) {
			printf("\n\n------------ Temporary code ------------\n\n");
			print_disassembly(handle, list, INFO);
			printf("\n\n------------ Applying Backtrace ------------\n\n");
			//tracing memory locations
			//printf("[+] Tracing memory (stack) locations\n");
			//trace_bottom_up_mem(handle, list, MODE);
			//tracing registers
			printf("\n[+] Tracing registers\n");
			List *temp_list = ListCreate();
			ListCopy(temp_list, list);
			Registers *regs = calloc(1, sizeof(Registers));
			emulate_stack_RW(handle, temp_list, regs, MODE);
			trace_bottom_up_reg(handle, list, regs, MODE);
			free(temp_list);
			free(regs);
		}
		//third pass
		if(THIRD_PASS) {
			printf("\n\n------------ Emulating stack R/W operations ------------\n\n");
			emulate_stack_RW(handle, list, NULL, MODE);
			print_disassembly(handle, list, INFO);
		}
		printf("\n\n------------ Final state ------------\n\n");
		print_disassembly(handle, list, INFO);
		//deleting insn saved value
		free(current);
		cs_free(insn, count);
	} else {
		printf("[-] Error: cs_disasm.\n");
	}
	cs_close(&handle);
	return 0;
}